import React, { Component } from "react";
import { Row, Col } from "antd";

export default class Intro extends Component {
  render() {
    return (
      <>
        <Row type="flex" justify="center" align="middle">
          <Row>
            <Col>
              <h1 style={{ fontFamily: "Poppins", overflow: "hidden" }}>
                DL 1961
              </h1>
            </Col>
          </Row>
        </Row>
        <Row
          type="flex"
          justify="center"
          align="middle"
          style={{
            flexDirection: "column",
            overflow: "hidden",
          }}
        >
          <Row>
            <Col>
              <h1>DIGITAG_PROGRAM</h1>
            </Col>
          </Row>
        </Row>
      </>
    );
  }
}
